  false,\n\t\"url\": null,\n\t\"notes\": \"The NMFS SWR has collected historical vessel
  information on the U.S. tuna cannery baitboat and purse seine fleets for many years.
  \ The database's first record of a baitboat entering the fleet dates back to 1927.
  \ Individual trip dates and locations for the purse seine fleet have been collected
  since July 1982.  Fleet operations have been conducted primarily in the north eastern
  and western central Pacific Ocean.  A quarterly fleet report was published between
  1972 and 2004. The database is historical with last updates in 2012.\",\n\t\"owner_org\":
